            </div>
            <div>
                <card>
                    <image src="src\image\contemporary-exterior.png" alt="card image cap"/>
                </card>
            </div>
            <div>
            <card>
                <CardImg top width="100%" src="C:\Users\daris\Desktop\Annonce\myannonce\public\logo192.png" alt="card image cap"/>
            </card>
            </div>
        </div>
    );
};

export default CategrieAnnonce;
